import XLSX from "xlsx";

export const ALLOW_EXTENTIONS = ["xlsx", "xls", "csv", "ods"]
	.map((item) => {
		return `.${item}`;
	})
	.join(",");

export const MAKE_CALLS = (refstr) => {
	let o = [],
		C = XLSX.utils.decode_range(refstr).e.c + 1;
	for (var i = 0; i < C; ++i) {
		o[i] = { name: XLSX.utils.encode_col(i), key: i };
	}
	return o;
};

export const HEADERS = [
	"AC_NO",
	"AC_NAME_EN",
	"PART_NAME_EN",
	"PSBUILDING_NAME_EN",
	"SECTION_NAME_EN",
	"FM_NAME_EN",
	"LASTNAME_EN",
	"RLN_FM_NM_EN",
	"RLN_L_NM_EN",
	"GENDER",
	"AGE",
	"PIN_CODE",
];
